  props: {
    size: {
      /**
       * `xs` | `s` | `m` | `l` | `xl`
       */
      type: String,
      default: "m"
    },
    /**
     * CSS color of `regular` | `danger`
     */
    backgroundColor: {
      type: String,
      default: "rgb(80, 100, 251)"
    },
    /**
     * Disabled
