    target: {
      type: String,
      default: null
    }
  },
  computed: {
    buttonStyle() {
      const
        styles = ['regular', 'danger'],
        exists = styles.indexOf(this.background)
      if (exists >= 0) {
        return styles[exists]
      } else {
        return "standard"
      }
    }
  }
}
